function LoginHeader () {
    return (
        <div className="loginHeader">
            <h1>Music Ranker </h1>
        </div>
    )
}

function LoginBox() {
    return ( 
        <div className="loginBox">
            <img src="src/spotify_logo.png" alt="spotify logo"></img>
            <p>Login With Spotify</p>
        </div>
    )
}


function LoginPage() {
    return (
        <div className="loginPage">
            <LoginHeader />
            <LoginBox />
        </div>
    )
}

export default LoginPage;
